import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function Chat() {
  const { id } = useParams();

  useEffect(() => {
    axiosInstance
      .post(`/createChat`, {
        cid: localStorage.getItem("CustomerLogId"),
        drid: id,
      })
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });


    axiosInstance.post(`/viewChatForDrwithCust/${id}`,{cid:localStorage.getItem('CustomerLogId')})
  },[]);
  return <div>Chat {id}</div>;
}

export default Chat;
